import React ,{useState}from 'react';
import { Card,Container, Row, Col } from 'react-bootstrap';
import { Modal } from 'react-bootstrap'
import EditContactForm from './EditContactForm';

const ContactUsers = (props) => {
    const [show, setShow] = useState(false);

    const handleClose = () => setShow(false);
    const handleShow = () => setShow(true);

    const HandleDelete = (e) => {
      e.preventDefault();
      props.delete(props.userData.id)
    }


    // const HandleDelete =(e)=> {
    //   e.preventDefault();
    // props.deleteUser(props.userInfo.id)
    // }
    return (
        <div>
       <Container>
       <Modal show={show} onHide={handleClose} animation={false}>
        <Modal.Header closeButton>
          <Modal.Title>Changes Here</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <EditContactForm editUser={props.editUser} prefill={props.userData} closeModal={handleClose} />
        </Modal.Body>
      </Modal>
        <Row>
            <Col>
            <Card style={{ width: '18rem' }}>
      <Card.Body>
        <Card.Title>Name:{props.userData.name}</Card.Title>
        <Card.Text>
         Phonenumber: {props.userData.phonenumber}
        </Card.Text>

        <Card.Text>
        Loaction: {props.userData.location}
        </Card.Text>
        <Button href="#" variant="primary" style={{marginRight:"10px", fontSize:"20px", width:"75px"}}> 
        Edit</Button>
    <Button href="#" variant="danger" style={{fontSize:"20px"}}>Delete </Button>
      </Card.Body>
    </Card>
            </Col>
        </Row>
       </Container>
        </div>
    );
}

export default ContactUsers;
